import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-nums',
  templateUrl: './nums.component.html',
  styleUrls: ['./nums.component.css']
})
export class NumsComponent {

  @Input() value: number = 0;
values = []
  constructor(){
    this.generateNum();
  }


  pressed() {
    console.info(this.value);
  }

  generateNum() {

    for ( let i = 0; i < 5; i++){
      const n= Math.floor(Math.random() * 30) + 1;
    this.values.push(n);
     }
     console.log(this.values);
  }

}
<p>Nums Component</p>

<div>
    <button type="button" (click)="generateNum()">Generate</button>
</div>

<img src="/assets/numbers/number{{value}}.jpg"
alt="Number"  
class="number">
